"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[3074],{6877:(n,s,a)=>{a.r(s),a.d(s,{data:()=>p});const p={key:"v-fcef0f32",path:"/css/text.html",title:"文本控制",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[{level:2,title:"文本基础",slug:"文本基础",children:[{level:3,title:"字体设置",slug:"字体设置",children:[]},{level:3,title:"字重定义",slug:"字重定义",children:[]},{level:3,title:"文本字号",slug:"文本字号",children:[]},{level:3,title:"文本颜色",slug:"文本颜色",children:[]},{level:3,title:"行高定义",slug:"行高定义",children:[]},{level:3,title:"倾斜风格",slug:"倾斜风格",children:[]},{level:3,title:"组合定义",slug:"组合定义",children:[]}]},{level:2,title:"文本样式",slug:"文本样式",children:[{level:3,title:"大小转换",slug:"大小转换",children:[]},{level:3,title:"文本线条",slug:"文本线条",children:[]},{level:3,title:"阴影控制",slug:"阴影控制",children:[]},{level:3,title:"空白处理",slug:"空白处理",children:[]},{level:3,title:"文本溢出 💡",slug:"文本溢出-💡",children:[]}]},{level:2,title:"段落控制",slug:"段落控制",children:[{level:3,title:"文本缩进",slug:"文本缩进",children:[]},{level:3,title:"水平对齐",slug:"水平对齐",children:[]},{level:3,title:"垂直对齐",slug:"垂直对齐",children:[]},{level:3,title:"字符间隔",slug:"字符间隔",children:[]},{level:3,title:"排版模式",slug:"排版模式",children:[]}]}],filePathRelative:"css/text.md",git:{updatedTime:1649446762e3,contributors:[{name:"Jerry Chen",email:"caffreygo@163.com",commits:2},{name:"JerryChen",email:"caffreygo@163.com",commits:2}]}}},5739:(n,s,a)=>{a.r(s),a.d(s,{default:()=>t});const p=(0,a(6252).uE)('<h1 id="文本控制" tabindex="-1"><a class="header-anchor" href="#文本控制" aria-hidden="true">#</a> 文本控制</h1><h2 id="文本基础" tabindex="-1"><a class="header-anchor" href="#文本基础" aria-hidden="true">#</a> 文本基础</h2><h3 id="字体设置" tabindex="-1"><a class="header-anchor" href="#字体设置" aria-hidden="true">#</a> 字体设置</h3><p>📗 可以定义多个字体，系统会依次查找，比如 <code>&#39;Courier New&#39;</code> 字体不存在将使用 <code>Courier</code> 以此类推。</p><p>Tips: 要使用通用字体，比如你电脑里有 <code>宋体</code> 在你电脑可以正常显示，但不保证在其他用户电脑可以正常，因为他们可能没有这个字体。</p><div class="language-css ext-css line-numbers-mode"><pre class="language-css"><code><span class="token property">font-family</span><span class="token punctuation">:</span> <span class="token string">&#39;Courier New&#39;</span><span class="token punctuation">,</span> Courier<span class="token punctuation">,</span> monospace<span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p><strong>自定义字体</strong></p><p>可以声明自定义字体，如果客户端不存在将下载该字体，使用方式也是通过 <code>font-family</code> 引入。📌</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token atrule"><span class="token rule">@font-face</span></span> <span class="token punctuation">{</span>\n        <span class="token property">font-family</span><span class="token punctuation">:</span> <span class="token string">&quot;source&quot;</span><span class="token punctuation">;</span>\n        <span class="token property">src</span><span class="token punctuation">:</span> <span class="token url"><span class="token function">url</span><span class="token punctuation">(</span><span class="token string url">&quot;SourceHanSansSC-Light.otf&quot;</span><span class="token punctuation">)</span></span> <span class="token function">format</span><span class="token punctuation">(</span><span class="token string">&quot;opentype&quot;</span><span class="token punctuation">)</span><span class="token punctuation">,</span>\n             <span class="token url"><span class="token function">url</span><span class="token punctuation">(</span><span class="token string url">&quot;SourceHanSansSC-Heavy.otf&quot;</span><span class="token punctuation">)</span></span> <span class="token function">format</span><span class="token punctuation">(</span><span class="token string">&quot;opentype&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n    <span class="token selector">span</span> <span class="token punctuation">{</span>\n        <span class="token property">font-family</span><span class="token punctuation">:</span> <span class="token string">&#39;source&#39;</span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br></div></div><table><thead><tr><th>字体</th><th>格式</th></tr></thead><tbody><tr><td>.otf</td><td>opentype</td></tr><tr><td>.woff</td><td>woff</td></tr><tr><td>.ttf</td><td>truetype</td></tr><tr><td>.eot</td><td>Embedded-opentype</td></tr></tbody></table><p>👾 不建议使用中文字体，因为文件<strong>太大</strong>且大部分是<strong>商业</strong>字体。</p><h3 id="字重定义" tabindex="-1"><a class="header-anchor" href="#字重定义" aria-hidden="true">#</a> 字重定义</h3><p>📗 字重指字的粗细定义。取值范围 <code>normal | bold | bolder | lighter | 100 ~900</code>。</p><p>400对应 <code>normal</code>,700对应 <code>bold</code> ，一般情况下使用 bold 或 normal 较多。</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">span</span> <span class="token punctuation">{</span>\n        <span class="token property">font-weight</span><span class="token punctuation">:</span> bold<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token selector">strong:last-child</span> <span class="token punctuation">{</span>\n        <span class="token property">font-weight</span><span class="token punctuation">:</span> normal<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>span</span><span class="token punctuation">&gt;</span></span>source.com<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>span</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>strong</span><span class="token punctuation">&gt;</span></span>mdn.com<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>strong</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br></div></div><h3 id="文本字号" tabindex="-1"><a class="header-anchor" href="#文本字号" aria-hidden="true">#</a> 文本字号</h3><p>📗 字号用于控制字符的显示大小，包括 <code>xx-small | x-small | small | meidum | large | x-large | xx-large</code>。</p><p><strong>百分数</strong></p><p>百分数是子元素相对于父元素的大小，如父元素是20px，子元素设置为 200%即为你元素的两倍大小。</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">article</span> <span class="token punctuation">{</span>\n        <span class="token property">font-size</span><span class="token punctuation">:</span> 20px<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token selector">span</span> <span class="token punctuation">{</span>\n        <span class="token property">font-size</span><span class="token punctuation">:</span> 500%<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>article</span><span class="token punctuation">&gt;</span></span>\n    <span class="token comment">&lt;!-- 100px --&gt;</span>\n\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>span</span><span class="token punctuation">&gt;</span></span>source.com<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>span</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>article</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br></div></div><p><strong>em</strong></p><p>em单位等同于百分数单位。(1em == 100%)</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">article</span> <span class="token punctuation">{</span>\n        <span class="token property">font-size</span><span class="token punctuation">:</span> 20px<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token selector">span</span> <span class="token punctuation">{</span>\n        <span class="token property">font-size</span><span class="token punctuation">:</span> 5em<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>article</span><span class="token punctuation">&gt;</span></span>\n    <span class="token comment">&lt;!-- 100px --&gt;</span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>span</span><span class="token punctuation">&gt;</span></span>source.com<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>span</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>article</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br></div></div><h3 id="文本颜色" tabindex="-1"><a class="header-anchor" href="#文本颜色" aria-hidden="true">#</a> 文本颜色</h3><p><strong>字符串颜色</strong></p><p>可以使用如 <code>red | green</code> 等字符颜色声明</p><div class="language-css ext-css line-numbers-mode"><pre class="language-css"><code><span class="token property">color</span><span class="token punctuation">:</span> red<span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p><strong>使用十六进制网页颜色</strong></p><div class="language-css ext-css line-numbers-mode"><pre class="language-css"><code><span class="token property">color</span><span class="token punctuation">:</span> #ddffde\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>如果颜色字符相同如 <code>#dddddd</code> 可以简写为 <code>#ddd</code></p><p><strong>使用RGB颜色</strong></p><div class="language-css ext-css line-numbers-mode"><pre class="language-css"><code><span class="token property">color</span><span class="token punctuation">:</span> <span class="token function">rgb</span><span class="token punctuation">(</span>38<span class="token punctuation">,</span> 149<span class="token punctuation">,</span> 162<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p><strong>透明颜色</strong></p><p>透明色从 <code>0~1</code> 间，表示从透明到不透明</p><div class="language-css ext-css line-numbers-mode"><pre class="language-css"><code><span class="token property">color</span><span class="token punctuation">:</span> <span class="token function">rgba</span><span class="token punctuation">(</span>38<span class="token punctuation">,</span> 149<span class="token punctuation">,</span> 162<span class="token punctuation">,</span>.2<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><h3 id="行高定义" tabindex="-1"><a class="header-anchor" href="#行高定义" aria-hidden="true">#</a> 行高定义</h3><div class="language-css ext-css line-numbers-mode"><pre class="language-css"><code><span class="token selector">div</span> <span class="token punctuation">{</span>\n    <span class="token property">line-height</span><span class="token punctuation">:</span> 2em<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><h3 id="倾斜风格" tabindex="-1"><a class="header-anchor" href="#倾斜风格" aria-hidden="true">#</a> 倾斜风格</h3><p>字符的倾斜样式控制</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">span</span> <span class="token punctuation">{</span>\n        <span class="token property">font-style</span><span class="token punctuation">:</span> italic<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token selector">em</span> <span class="token punctuation">{</span>\n        <span class="token property">font-style</span><span class="token punctuation">:</span> normal<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>span</span><span class="token punctuation">&gt;</span></span>source.com<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>span</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>hr</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>em</span><span class="token punctuation">&gt;</span></span>mdn.com<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>em</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br></div></div><h3 id="组合定义" tabindex="-1"><a class="header-anchor" href="#组合定义" aria-hidden="true">#</a> 组合定义</h3><div class="custom-container tip"><p class="custom-container-title">可以使用 font 一次将字符样式定义，但要注意必须存在以下几点：</p><ul><li>必须有字体规则(&#39;Courier New&#39;, Courier, monospace)</li><li>必须有字符大小规则(20px/1.5)</li></ul></div><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code>span {\n\tfont: bold italic 20px/1.5 &#39;Courier New&#39;, Courier, monospace;\n}\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>span</span><span class="token punctuation">&gt;</span></span>source.com<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>span</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><blockquote><p>上例中的 20px 为字体大小，1.5为1.5倍行高定义</p></blockquote><h2 id="文本样式" tabindex="-1"><a class="header-anchor" href="#文本样式" aria-hidden="true">#</a> 文本样式</h2><h3 id="大小转换" tabindex="-1"><a class="header-anchor" href="#大小转换" aria-hidden="true">#</a> 大小转换</h3><p>小号大写字母（字体变小，全转大写）</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">.font-variant</span> <span class="token punctuation">{</span>\n        <span class="token property">font-variant</span><span class="token punctuation">:</span> small-caps<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>span</span><span class="token punctuation">&gt;</span></span>source.com<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>span</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>span</span> <span class="token attr-name">class</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">&quot;</span>font-variant<span class="token punctuation">&quot;</span></span><span class="token punctuation">&gt;</span></span>source.com<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>span</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/1.png" alt=""></p><p>字母大小写转换</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">h2</span> <span class="token punctuation">{</span>\n        <span class="token comment">/* 首字母大写 */</span>\n        <span class="token property">text-transform</span><span class="token punctuation">:</span> capitalize<span class="token punctuation">;</span>\n\n        <span class="token comment">/* 全部大写 */</span>\n        <span class="token property">text-transform</span><span class="token punctuation">:</span> uppercase<span class="token punctuation">;</span>\n\n        <span class="token comment">/* 全部小写 */</span>\n        <span class="token property">text-transform</span><span class="token punctuation">:</span> lowercase<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br></div></div><h3 id="文本线条" tabindex="-1"><a class="header-anchor" href="#文本线条" aria-hidden="true">#</a> 文本线条</h3><p>添加隐藏删除线</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">a</span> <span class="token punctuation">{</span>\n        <span class="token property">text-decoration</span><span class="token punctuation">:</span> none<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token selector">span.underline</span> <span class="token punctuation">{</span>\n        <span class="token property">text-decoration</span><span class="token punctuation">:</span> underline<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token selector">span.through</span> <span class="token punctuation">{</span>\n        <span class="token property">text-decoration</span><span class="token punctuation">:</span> line-through<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token selector">span.overline</span> <span class="token punctuation">{</span>\n        <span class="token property">text-decoration</span><span class="token punctuation">:</span> overline<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>a</span> <span class="token attr-name">href</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">&quot;</span><span class="token punctuation">&quot;</span></span><span class="token punctuation">&gt;</span></span>source.com<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>a</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>hr</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>span</span> <span class="token attr-name">class</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">&quot;</span>underline<span class="token punctuation">&quot;</span></span><span class="token punctuation">&gt;</span></span>下划线<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>span</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>hr</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>span</span> <span class="token attr-name">class</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">&quot;</span>through<span class="token punctuation">&quot;</span></span><span class="token punctuation">&gt;</span></span>删除线<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>span</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>hr</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>span</span> <span class="token attr-name">class</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">&quot;</span>overline<span class="token punctuation">&quot;</span></span><span class="token punctuation">&gt;</span></span>上划线<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>span</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br><span class="line-number">15</span><br><span class="line-number">16</span><br><span class="line-number">17</span><br><span class="line-number">18</span><br><span class="line-number">19</span><br><span class="line-number">20</span><br><span class="line-number">21</span><br><span class="line-number">22</span><br><span class="line-number">23</span><br><span class="line-number">24</span><br><span class="line-number">25</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/2.png" alt=""></p><h3 id="阴影控制" tabindex="-1"><a class="header-anchor" href="#阴影控制" aria-hidden="true">#</a> 阴影控制</h3><p>参数顺序为：颜色，水平偏移，垂直偏移，模糊度。</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">h2</span> <span class="token punctuation">{</span>\n        <span class="token property">text-shadow</span><span class="token punctuation">:</span> <span class="token function">rgba</span><span class="token punctuation">(</span>13<span class="token punctuation">,</span> 6<span class="token punctuation">,</span> 89<span class="token punctuation">,</span> 0.8<span class="token punctuation">)</span> 3px 3px 5px<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h2</span><span class="token punctuation">&gt;</span></span>source.com<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h2</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/3.png" alt=""></p><h3 id="空白处理" tabindex="-1"><a class="header-anchor" href="#空白处理" aria-hidden="true">#</a> 空白处理</h3><p>使用 <code>white-space</code> 控制文本空白显示。</p><table><thead><tr><th>选项</th><th>说明</th></tr></thead><tbody><tr><td>pre</td><td>保留文本中的所有空白，类似使用 pre 标签</td></tr><tr><td>nowrap</td><td>禁止文本换行</td></tr><tr><td>pre-wrap</td><td>保留空白，保留换行符</td></tr><tr><td>pre-line</td><td>空白合并，保留换行符</td></tr></tbody></table><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">h2</span> <span class="token punctuation">{</span>\n        <span class="token property">white-space</span><span class="token punctuation">:</span> pre<span class="token punctuation">;</span>\n        <span class="token property">width</span><span class="token punctuation">:</span> 200px<span class="token punctuation">;</span>\n        <span class="token property">border</span><span class="token punctuation">:</span> solid 1px #ddd<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h2</span><span class="token punctuation">&gt;</span></span>hel lo World<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h2</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/4.png" alt=""></p><h3 id="文本溢出-💡" tabindex="-1"><a class="header-anchor" href="#文本溢出-💡" aria-hidden="true">#</a> 文本溢出 💡</h3><p><strong>单行文本</strong></p><p>溢出文本容器后换行处理，不加<code>overflow-wrap: break-word;</code>文本会溢出h2容器。</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">h2</span> <span class="token punctuation">{</span>\n        <span class="token property">overflow-wrap</span><span class="token punctuation">:</span> break-word<span class="token punctuation">;</span>\n        <span class="token property">width</span><span class="token punctuation">:</span> 100px<span class="token punctuation">;</span>\n        <span class="token property">border</span><span class="token punctuation">:</span> solid 1px #ddd<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h2</span><span class="token punctuation">&gt;</span></span>helloWorld<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h2</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/5.png" alt=""></p><p>溢出内容末尾添加 <code>...</code></p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">div</span> <span class="token punctuation">{</span>\n        <span class="token property">width</span><span class="token punctuation">:</span> 200px<span class="token punctuation">;</span>\n        <span class="token property">border</span><span class="token punctuation">:</span> solid 1px blueviolet<span class="token punctuation">;</span>\n        <span class="token property">white-space</span><span class="token punctuation">:</span> nowrap<span class="token punctuation">;</span>\n        <span class="token property">overflow</span><span class="token punctuation">:</span> hidden<span class="token punctuation">;</span>\n        <span class="token property">text-overflow</span><span class="token punctuation">:</span> ellipsis<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>div</span><span class="token punctuation">&gt;</span></span>\n    泉州市地处福建省東南沿海，介于上海和湛江两大港口之间的海岸线中段；全市范围位于东经117°35′-l19°05′，北纬24°23′-25°56′之间，東西宽约138公里，南北長约157公里。\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>div</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/6.png" alt=""></p><p><strong>多行文本</strong></p><p>控制多行文本溢出时添加 <code>...</code></p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">div</span> <span class="token punctuation">{</span>\n        <span class="token property">width</span><span class="token punctuation">:</span> 200px<span class="token punctuation">;</span>\n        <span class="token property">border</span><span class="token punctuation">:</span> solid 1px blueviolet<span class="token punctuation">;</span>\n        <span class="token property">overflow</span><span class="token punctuation">:</span> hidden<span class="token punctuation">;</span>\n        <span class="token property">display</span><span class="token punctuation">:</span> -webkit-box<span class="token punctuation">;</span>\n        <span class="token property">-webkit-box-orient</span><span class="token punctuation">:</span> vertical<span class="token punctuation">;</span>\n        <span class="token property">-webkit-line-clamp</span><span class="token punctuation">:</span> 2<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>div</span><span class="token punctuation">&gt;</span></span>\n    泉州市地处福建省東南沿海，介于上海和湛江两大港口之间的海岸线中段；全市范围位于东经117°35′-l19°05′，北纬24°23′-25°56′之间，東西宽约138公里，南北長约157公里。\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>div</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/7.png" alt=""></p><p><strong>表格文本溢出</strong></p><p>表格文本溢出控制需要为 table 标签定义 <code>table-layout: fixed;</code> css样式，表示列宽是由表格和单元格宽度定义。</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">table</span> <span class="token punctuation">{</span>\n        <span class="token property">table-layout</span><span class="token punctuation">:</span> fixed<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token selector">table tbody tr td</span> <span class="token punctuation">{</span>\n        <span class="token property">white-space</span><span class="token punctuation">:</span> nowrap<span class="token punctuation">;</span>\n        <span class="token property">overflow</span><span class="token punctuation">:</span> hidden<span class="token punctuation">;</span>\n        <span class="token property">text-overflow</span><span class="token punctuation">:</span> ellipsis<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br></div></div><h2 id="段落控制" tabindex="-1"><a class="header-anchor" href="#段落控制" aria-hidden="true">#</a> 段落控制</h2><h3 id="文本缩进" tabindex="-1"><a class="header-anchor" href="#文本缩进" aria-hidden="true">#</a> 文本缩进</h3><p>控制元素部的文本、图片进行缩进操作（2em可表示2个字体宽度）</p><div class="language-css ext-css line-numbers-mode"><pre class="language-css"><code><span class="token selector">p</span> <span class="token punctuation">{</span>\n    <span class="token property">text-indent</span><span class="token punctuation">:</span> 2em<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><h3 id="水平对齐" tabindex="-1"><a class="header-anchor" href="#水平对齐" aria-hidden="true">#</a> 水平对齐</h3><p>使用 <code>left|right|center</code> 对文本进行对齐操作</p><div class="language-css ext-css line-numbers-mode"><pre class="language-css"><code><span class="token selector">h2</span> <span class="token punctuation">{</span>\n    <span class="token property">text-align</span><span class="token punctuation">:</span> center<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><p>为了让段落内容看得舒服，需要设置合适的行高</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">p</span> <span class="token punctuation">{</span>\n        <span class="token property">text-indent</span><span class="token punctuation">:</span> 2em<span class="token punctuation">;</span>\n        <span class="token property">line-height</span><span class="token punctuation">:</span> 2em<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">&gt;</span></span>\n    泉州市地处福建省東南沿海，介于上海和湛江两大港口之间的海岸线中段；全市范围位于东经117°35′-l19°05′，北纬24°23′-25°56′之间，東西宽约138公里，南北長约157公里。\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/8.png" alt=""></p><h3 id="垂直对齐" tabindex="-1"><a class="header-anchor" href="#垂直对齐" aria-hidden="true">#</a> 垂直对齐</h3><p>使用 <code>vertical-align</code> 用于定义内容的垂直对齐风格，包括<code>middle | baseline | sub | super</code> 等。</p><p><strong>图像在段落中居中对齐</strong></p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">img</span> <span class="token punctuation">{</span>\n        <span class="token property">height</span><span class="token punctuation">:</span> 50px<span class="token punctuation">;</span>\n        <span class="token property">vertical-align</span><span class="token punctuation">:</span> middle<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">&gt;</span></span>\n    泉州市地处福建省東南沿海，介于上海和湛江两大港口之间的海岸线中段；<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>img</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">&quot;</span>1.jpg<span class="token punctuation">&quot;</span></span> <span class="token punctuation">/&gt;</span></span>全市范围位于东经117°35′-l19°05′，北纬24°23′-25°56′之间，東西宽约138公里，南北長约157公里。\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/9.png" alt=""></p><p><strong>顶部与底部对齐</strong></p><p><code>bottom | top</code> 相对于行框底部或顶部对齐。</p><div class="language-html ext-html line-numbers-mode"><pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>style</span><span class="token punctuation">&gt;</span></span><span class="token style"><span class="token language-css">\n    <span class="token selector">h2 &gt; span</span> <span class="token punctuation">{</span>\n        <span class="token property">vertical-align</span><span class="token punctuation">:</span> bottom<span class="token punctuation">;</span>\n        <span class="token property">font-size</span><span class="token punctuation">:</span> 12px<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>style</span><span class="token punctuation">&gt;</span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h2</span><span class="token punctuation">&gt;</span></span>source.com <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>span</span><span class="token punctuation">&gt;</span></span>mdn<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>span</span><span class="token punctuation">&gt;</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h2</span><span class="token punctuation">&gt;</span></span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/10.png" alt=""></p><p><strong>使用单位对齐</strong></p><p>可以使用具体数值设置对齐的位置。</p><div class="language-css ext-css line-numbers-mode"><pre class="language-css"><code><span class="token selector">h2&gt;span</span> <span class="token punctuation">{</span>\n\t<span class="token property">vertical-align</span><span class="token punctuation">:</span> -20px<span class="token punctuation">;</span>\n\t<span class="token property">font-size</span><span class="token punctuation">:</span> 12px<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/11.png" alt=""></p><h3 id="字符间隔" tabindex="-1"><a class="header-anchor" href="#字符间隔" aria-hidden="true">#</a> 字符间隔</h3><p><strong>单词与字符间距</strong></p><p>使用 <code>word-spacing</code> 与 <code>letter-spacing</code> 控制单词与字符间距。</p><div class="language-css ext-css line-numbers-mode"><pre class="language-css"><code><span class="token selector">h2</span> <span class="token punctuation">{</span>\n    <span class="token property">word-spacing</span><span class="token punctuation">:</span> 2em<span class="token punctuation">;</span>\n    <span class="token property">letter-spacing</span><span class="token punctuation">:</span> 3em<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div><h3 id="排版模式" tabindex="-1"><a class="header-anchor" href="#排版模式" aria-hidden="true">#</a> 排版模式</h3><table><thead><tr><th>模式</th><th>说明</th></tr></thead><tbody><tr><td>horizontal-tb</td><td>水平方向自上而下的书写方式</td></tr><tr><td>vertical-rl</td><td>垂直方向自右而左的书写方式</td></tr><tr><td>vertical-lr</td><td>垂直方向内内容从上到下，水平方向从左到右</td></tr></tbody></table><div class="language-css ext-css line-numbers-mode"><pre class="language-css"><code><span class="token selector">div</span> <span class="token punctuation">{</span>\n    <span class="token property">height</span><span class="token punctuation">:</span> 200px<span class="token punctuation">;</span>\n    <span class="token property">border</span><span class="token punctuation">:</span> solid 1px #ddd<span class="token punctuation">;</span>\n    <span class="token property">writing-mode</span><span class="token punctuation">:</span> vertical-rl<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><p><img src="https://raw.githubusercontent.com/caffreygo/static/main/blog/css/text/12.png" alt=""></p>',110),t={render:function(n,s){return p}}}}]);